exports.getPrices = async (req, res) => {
  const { placements } = await listLayouts(req.user.id).then((ls) =>
    ls.find((l) => l.id == req.params.id),
  );
  const itemIds = placements.map((p) => p.itemId);
  const prices = await fetchPartnerPrices(itemIds);
  res.json(prices);
};
